import React from 'react';
import cx from 'classnames';
import { observer } from 'mobx-react';
import FramesStore from '../store/FramesStore';
import i18n from '../locales';
import './FrameValidation.scss';

interface FrameValidationProps {
  readonly: boolean;
  currentFrame: number;
}

const FrameValidation = observer(({ readonly, currentFrame }: FrameValidationProps) => {
  const currentFrameValid = FramesStore.isFrameValid(currentFrame);
  return (
    <div className="frame-valid-switch">
      <div
        className={cx('', {
          disabled: readonly,
          active: currentFrameValid,
          invalid: !currentFrameValid,
        })}
        onClick={() => FramesStore.setFrameValid(currentFrame, true)}
      >
        {i18n.translate('FRAME_ATTRIBUTES_VALID')}
      </div>
      <div
        className={cx('', {
          disabled: readonly,
          active: !currentFrameValid,
          invalid: !currentFrameValid,
        })}
        onClick={() => FramesStore.setFrameValid(currentFrame, false)}
      >
        {i18n.translate('FRAME_ATTRIBUTES_INVALID')}
      </div>
    </div>
  );
});

export default FrameValidation;
